INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24001, 2, 24, 10046, 401, "アヤネ", 2, 0.0, "2030/12/17 14:59:59", 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 2.21, 24002, 1, 24, 10046, 402, "アヤネ", 2, 0.0, "2030/12/17 14:59:59", 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24003, 2, 24, 10046, 403, "アヤネ", 2, 0.0, "2030/12/17 14:59:59", 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 1.99, 24004, 2, 24, 10046, 701, "アサヒ", 1, 0.0, "2030/12/17 14:59:59", 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 2.21, 24005, 1, 24, 10046, 702, "アサヒ", 2, 0.0, "2030/12/17 14:59:59", 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 3.33, 24006, 2, 24, 10046, 703, "アサヒ", 1, 0.0, "2030/12/17 14:59:59", 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24007, 2, 24, 10046, 801, "部員３", 2, 0.0, "2030/12/17 14:59:59", 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 2.68, 24008, 1, 24, 10046, 802, "部員３", 2, 0.0, "2030/12/17 14:59:59", 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24009, 2, 24, 10046, 803, "部員３", 2, 0.0, "2030/12/17 14:59:59", 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24010, 1, 24, 10046, 501, "", 1, 0.0, "2030/12/17 14:59:59", 192501, "やった！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24011, 1, 24, 10046, 502, "", 1, 0.0, "2030/12/17 14:59:59", 192501, "勝ったよ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24012, 1, 24, 10046, 503, "", 1, 0.0, "2030/12/17 14:59:59", 192501, "いい調子！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 5.33, 24013, 6, 24, 10046, 111, "ミサト", 2, 0.0, "2030/12/17 14:59:59", 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 6.85, 24014, 1, 24, 10046, 112, "ミサト", 2, 0.0, "2030/12/17 14:59:59", 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 3.0, 24015, 1, 24, 10046, 113, "ミサト", 2, 0.0, "2030/12/17 14:59:59", 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 6.11, 24016, 1, 24, 10046, 611, "ダイチ", 2, 0.0, "2030/12/17 14:59:59", 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 6.75, 24017, 1, 24, 10046, 612, "ダイチ", 2, 0.0, "2030/12/17 14:59:59", 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24018, 2, 24, 10046, 613, "ダイチ", 2, 0.0, "2030/12/17 14:59:59", 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 4.52, 24019, 2, 24, 10046, 211, "ハツネ", 1, 0.0, "2030/12/17 14:59:59", 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 3.89, 24020, 2, 24, 10046, 212, "ハツネ", 1, 0.0, "2030/12/17 14:59:59", 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 13.49, 24021, 1, 24, 10046, 213, "ハツネ", 2, 0.0, "2030/12/17 14:59:59", 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 3.17, 24022, 1, 24, 10046, 311, "カヤ", 2, 0.0, "2030/12/17 14:59:59", 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 4.42, 24023, 1, 24, 10046, 312, "カヤ", 2, 0.0, "2030/12/17 14:59:59", 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 2.89, 24024, 6, 24, 10046, 313, "カヤ", 1, 0.0, "2030/12/17 14:59:59", 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 3.71, 24025, 4, 24, 10046, 421, "アヤネ", 3, 0.0, "2030/12/17 14:59:59", 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 5.1, 24026, 2, 24, 10046, 721, "アサヒ", 1, 0.0, "2030/12/17 14:59:59", 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 4.34, 24027, 1, 24, 10046, 821, "部員３", 3, 0.0, "2030/12/17 14:59:59", 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, 0.0, 24028, 1, 24, 10046, 521, "", 1, 0.0, "2030/12/17 14:59:59", 192501, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, 5.62, 24029, 1, 24, 10046, 101, "ミサト", 2, 0.0, "2030/12/17 14:59:59", 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, 9.58, 24030, 1, 24, 10046, 102, "ミサト", 2, 0.0, "2030/12/17 14:59:59", 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, 0.0, 24031, 2, 24, 10046, 103, "ミサト", 2, 0.0, "2030/12/17 14:59:59", 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, 9.13, 24032, 2, 24, 10046, 104, "ミサト", 1, 0.0, "2030/12/17 14:59:59", 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, 8.27, 24033, 1, 24, 10046, 105, "ミサト", 2, 0.0, "2030/12/17 14:59:59", 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00");
